import Works from "../Works";

const Card = ({ number, name, desc, gitlink, demo }) => {
  return (
    <S.Card>
      <div className="details">
        <h2>{number}</h2>
        <h1>{name}</h1>
        <p>{desc}</p>
      </div>
      <div>
        <button href={gitlink}></button>
        <button href={demo}></button>
      </div>
    </S.Card>
  );
};

export default Card;
